import Container from "react-bootstrap/Container"
import CardStyle from "./Card"

export const CardList = ({ Datas, Loading, setCartArticle }) => (
	<Container className="d-flex flex-wrap mt-3"
		style={{ justifyContent: 'center', alignItems: 'center' }}
	>
		{Loading ? (
			<div>Loading...</div>
		) : (
			Datas.map(
				person => { 
					if(person.id=1){
						person.price=28
					}
				<CardStyle key={person.id} person={person} setCartArticle={setCartArticle} /> 
			}

			)
		)}
	</Container>
)
